import React from "react";
import { Container, Row,Col } from "react-bootstrap";
import logo from './footer-logo.png'


function Footer() {
    return ( 
        <div className="footercont mt-5">
            <Container className="cartnum  pt-5">
                <Row>
                    <Col> 
                    <img src={logo} alt='logo'></img> 
                    <p className="text-secondary">The customer is at the heart of our unique business model, which includes design.</p>
                    </Col>
                </Row>
             
            </Container>
        
        </div>
     );
}

export default Footer;
